import React, { useState, useEffect } from 'react';
import { TextField, Button, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';
import axios from 'axios';

const SignupComponent = () => {
  const [users, setUsers] = useState([]);
  const [formData, setFormData] = useState({ firstName: '', lastName: '', email: '', password: '' });
  const [editUserId, setEditUserId] = useState(null);

  useEffect(() => {
    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    const response = await axios.get('http://localhost:3001/api/signup');
    setUsers(response.data);
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (editUserId) {
      await axios.put(`http://localhost:3001/api/signup/${editUserId}`, formData);
      setEditUserId(null);
    } else {
      await axios.post('http://localhost:3001/api/signup', formData);
    }
    setFormData({ firstName: '', lastName: '', email: '', password: '' });
    fetchUsers();
  };

  const handleEdit = (user) => {
    setFormData(user);
    setEditUserId(user._id);
  };

  const handleDelete = async (id) => {
    await axios.delete(`http://localhost:3001/api/signup/${id}`);
    fetchUsers();
  };

  return (
    <div style={{ padding: 20 }}>
      <form onSubmit={handleSubmit}>
        <TextField
          label="First Name"
          name="firstName"
          value={formData.firstName}
          onChange={handleChange}
          required
          margin="normal"
          fullWidth
        />
        <TextField
          label="Last Name"
          name="lastName"
          value={formData.lastName}
          onChange={handleChange}
          required
          margin="normal"
          fullWidth
        />
        <TextField
          label="Email"
          name="email"
          value={formData.email}
          onChange={handleChange}
          required
          margin="normal"
          fullWidth
        />
        <TextField
          label="Password"
          name="password"
          type="password"
          value={formData.password}
          onChange={handleChange}
          required
          margin="normal"
          fullWidth
        />
        <Button type="submit" variant="contained" color="primary">
          {editUserId ? 'Update User' : 'Add User'}
        </Button>
      </form>

      <TableContainer component={Paper} style={{ marginTop: 20 }}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>First Name</TableCell>
              <TableCell>Last Name</TableCell>
              <TableCell>Email</TableCell>
              <TableCell>Password</TableCell>
              <TableCell>Actions</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {users.map((user) => (
              <TableRow key={user._id}>
                <TableCell>{user.firstName}</TableCell>
                <TableCell>{user.lastName}</TableCell>
                <TableCell>{user.email}</TableCell>
                <TableCell>{user.password}</TableCell>
                <TableCell>
                  <Button onClick={() => handleEdit(user)} color="primary">Edit</Button>
                  <Button onClick={() => handleDelete(user._id)} color="secondary">Delete</Button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};

export default SignupComponent;
